import React from "react";
import { motion } from "framer-motion";
import "./HouseListing.css";

const HouseListing = () => {
  const houses = [
    { id: 1, location: "Nairobi, Westlands", category: "Single Room", price: 20000, image: "house1.jpg" },
    { id: 2, location: "Kilimani, Nairobi", category: "One-Bedroom", price: 35000, image: "house2.jpg" },
    { id: 3, location: "Umoja, Eastlands", category: "Bedsitter", price: 12000, image: "house3.jpg" },
  ];

  return (
    <div className="listing-container">
      {houses.map((house) => (
        <motion.div key={house.id} className="house-card">
          <img src={house.image} alt={house.category} className="house-image" />
          <h3 className="house-title">{house.category}</h3>
          <p className="house-text"><strong>Location:</strong> {house.location}</p>
          <p className="house-text"><strong>Price:</strong> KSh {house.price}</p>
        </motion.div>
      ))}
    </div>
  );
};

export default HouseListing;
